import React from 'react'
import axios from 'axios';

function ViewNotes() {

    const addNote = (id, text) => {
        const API_URL = "http://127.0.0.1:8000/test/addnote/";

        axios
          .post(API_URL, {
            id: id,
            text: text
          })
          .then(function (response) {
            console.log(response);
          })
          .catch(function (error) {
            console.log(error);
          });
      };

    return (
        <div>
            <h2>Notes</h2>
        </div>
    )
}

export default ViewNotes
